import '../../styles.css'
import Logo from "../../Logo.png";
import hh from "../../13153.jpg"
//import 'bootstrap/dist/css/bootstrap.min.css';
import {NavbarBrand,Navbar,NavbarText, Container} from 'reactstrap'
import Card from '../Card'

const App =()=>{
  return (
    <div className="App">
    <Navbar
    color="light"
    expand="md"
    light
  >
    <NavbarBrand href="/">
    <h1>nearby Therapist</h1>
    <span>Find Your Top Local Therapists</span>
    </NavbarBrand>
      </Navbar>
      <Container className="bg-light border">
    <img src={hh} style={{width:"80%"}} />
    <div class="Search__SearchWrapper-npf78n-0 ZQlbd"><div class="Search__SearchContainer-npf78n-1 SgZDo"><div class="TabBar__Bar-sc-l1exxv-0 ioDWwb Search__StyledTabBar-npf78n-3 xglfc"><div class="TabList__TabListWrapper-sc-oyim0-0 TabList___StyledTabListWrapper-sc-oyim0-1 igWnYC Search__StyledTabList-npf78n-2 hHqbeq"><div class="styles__ChevronWrapper-sc-1oboby8-4 gfkQfO"><button tabindex="-1" aria-label="Scroll left" class="styles__ChevronButton-sc-1oboby8-2 fnlUcl"><svg viewBox="0 0 16 16" class="ArrowLeftMd__StyledSVG-sc-16n9n4u-0 gRIOFv"><path stroke="currentColor" d="M10 2L4 8l6 6" fill="none" fill-rule="evenodd" stroke-linecap="round" stroke-linejoin="round"></path></svg></button><div class="styles__FadeySpacer-sc-1oboby8-3 eQYlYb"></div></div><ul role="tablist" class="styles__HorizontalList-sc-1oboby8-0 iYuBHE"><li role="presentation" width="20%" class="styles__HorizontalListItem-sc-1oboby8-5 jPsAaU"><button role="tab" aria-selected="true" tabindex="0" selected="" class="styles__TabButton-sc-1oboby8-6 hGTDDc">Buy</button><span class="styles__FloatyLine-sc-1oboby8-1 eSVtkq" style="transition: transform 0.2s ease 0s;"></span></li><li role="presentation" width="20%" class="styles__HorizontalListItem-sc-1oboby8-5 jPsAaU"><button role="tab" aria-selected="false" tabindex="-1" class="styles__TabButton-sc-1oboby8-6 ieOizc">Rent</button><span class="styles__FloatyLine-sc-1oboby8-1 kdRmOl" style="transition: transform 0.2s ease 0s;"></span></li><li role="presentation" width="20%" class="styles__HorizontalListItem-sc-1oboby8-5 jPsAaU"><button role="tab" aria-selected="false" tabindex="-1" class="styles__TabButton-sc-1oboby8-6 ieOizc">Sold</button><span class="styles__FloatyLine-sc-1oboby8-1 kdRmOl" style="transition: transform 0.2s ease 0s;"></span></li><li role="presentation" width="20%" class="styles__HorizontalListItem-sc-1oboby8-5 jPsAaU"><button role="tab" aria-selected="false" tabindex="-1" class="styles__TabButton-sc-1oboby8-6 ieOizc">Address</button><span class="styles__FloatyLine-sc-1oboby8-1 kdRmOl" style="transition: transform 0.2s ease 0s;"></span></li><li role="presentation" width="20%" class="styles__HorizontalListItem-sc-1oboby8-5 jPsAaU"><button role="tab" aria-selected="false" tabindex="-1" class="styles__TabButton-sc-1oboby8-6 ieOizc">Agents</button><span class="styles__FloatyLine-sc-1oboby8-1 kdRmOl" style="transition: transform 0.2s ease 0s;"></span></li><div dir="ltr" class="resize-sensor" style="pointer-events: none; position: absolute; inset: 0px; overflow: hidden; z-index: -1; visibility: hidden; max-width: 100%;"><div class="resize-sensor-expand" style="pointer-events: none; position: absolute; inset: 0px; overflow: hidden; z-index: -1; visibility: hidden; max-width: 100%;"><div style="position: absolute; left: 0px; top: 0px; transition: all 0s ease 0s; width: 738px; height: 71px;"></div></div><div class="resize-sensor-shrink" style="pointer-events: none; position: absolute; inset: 0px; overflow: hidden; z-index: -1; visibility: hidden; max-width: 100%;"><div style="position: absolute; left: 0px; top: 0px; transition: all 0s ease 0s; width: 200%; height: 200%;"></div></div></div></ul><div class="styles__ChevronWrapper-sc-1oboby8-4 jnQIxl"><div class="styles__FadeySpacer-sc-1oboby8-3 ehQFwD"></div><button tabindex="-1" aria-label="Scroll right" class="styles__ChevronButton-sc-1oboby8-2 fnlUcl"><svg viewBox="0 0 16 16" class="ArrowRightMd__StyledSVG-sc-gyz8e5-0 kfkMHv"><path stroke="currentColor" d="M6 2l6 6-6 6" fill="none" fill-rule="evenodd" stroke-linecap="round" stroke-linejoin="round"></path></svg></button></div></div></div><div class="Inline__InlineContainer-sc-lf7x8d-0 jwACxo SearchBar__SearchBarContainer-sc-1vtgn0-0 bZEAFv"><button aria-label="Select suburb, postcode, or states to buy a property in" class="ButtonBase-sc-18zziu4-0 bVhlgb SearchButton__StyledButton-y1gfm6-0 fXIMvL" aria-haspopup="dialog" aria-expanded="false"><svg viewBox="0 0 16 16" class="SearchMd__StyledSVG-sc-doznwu-0 lhcbjR"><path d="M5.996 10.993a4.996 4.996 0 100-9.993 4.996 4.996 0 000 9.993zM9.701 9.7l4.946 4.946" stroke="currentColor" fill="none" fill-rule="evenodd" stroke-linecap="round" stroke-linejoin="round"></path></svg><span class="Button__LabelWithMargin-sc-ne0dpg-1 hAJYIJ">Search suburb, postcode or state</span></button><div class="SearchBar__ButtonContainer-sc-1vtgn0-1 grzvno"><button aria-label="Apply filters" aria-haspopup="dialog" aria-expanded="false" class="ButtonBase-sc-18zziu4-0 iuKmQk FiltersButton__StyledButton-sc-19wr2mu-0 kcVFHU"><svg viewBox="0 0 16 16" class="FilterMd__StyledSVG-sc-1ii71hj-0 iTnfJD"><path d="M7 5h8M1 5h2m2 2a2 2 0 100-4 2 2 0 000 4zm4 4H1m14 0h-2m-2 2a2 2 0 110-4 2 2 0 010 4z" stroke="currentColor" fill="none" fill-rule="evenodd" stroke-linecap="round" stroke-linejoin="round"></path></svg><span class="Button__LabelWithMargin-sc-ne0dpg-1 hAJYIJ">Filters</span></button><button aria-label="Apply filters and search" class="ButtonBase-sc-18zziu4-0 ksPwGW SubmitSearchButton__StyledButton-sc-7ign35-0 duRQpz">Search</button></div></div></div></div>
  </Container>
  <Container className="bg-light border" >
    <Card/>
    </Container>
  </div>
    
  );
  }

export default App;
